import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import HomePage from "./pages/HomePage";
import CodeBlockPage1 from "./pages/CodeBlockPage1";
import CodeBlockPage2 from "./pages/CodeBlockPage2";
import CodeBlockPage3 from "./pages/CodeBlockPage3";
import CodeBlockPage4 from "./pages/CodeBlockPage4";
import ClassListNavigation from "./components/ClassListNavigation";

const AppRouter = () => {
  return (
    <Router>
      <ClassListNavigation />
      <Routes>
        <Route exact path="/" element={<HomePage />} />
        <Route exact path="/code-block-page-1" element={<CodeBlockPage1 />} />
        <Route exact path="/code-block-page-2" element={<CodeBlockPage2 />} />
        <Route exact path="/code-block-page-3" element={<CodeBlockPage3 />} />
        <Route exact path="/code-block-page-4" element={<CodeBlockPage4 />} />
      </Routes>
    </Router>
  );
};

export default AppRouter;
